import './StackedTab.css';
import rouletteImage from './roulette_img.png';
import {useState} from 'react';

function StackedTab() {

    const [number1, setNumber1] = useState('');
    const [number2, setNumber2] = useState('');
    const [number3, setNumber3] = useState('');
    const [number4, setNumber4] = useState('');
    const [number5, setNumber5] = useState('');
    const [number6, setNumber6] = useState('');

    const [invalid,setInvalid] = useState(false);

    const handleOkclick = () =>{

        const numbers = [number1, number2, number3, number4, number5, number6];
        const areAllNumbersValid = numbers.every(num => !isNaN(num) && num !== '');
        
        if(
            isNaN(number1) ||
            isNaN(number2) ||
            isNaN(number3) ||
            isNaN(number4) ||
            isNaN(number5) ||
            isNaN(number6)
        ) {
            setInvalid(true);
            alert('Please enter valid numbers');
            return;
        }

        setInvalid(false);
        console.log('Number 1:', number1);
        console.log('Number 2:', number2);
        console.log('Number 3:', number3);
        console.log('Number 4:', number4);
        console.log('Number 5:', number5);
        console.log('Number 6:', number6);
        alert(`Numbers entered: ${number1}, ${number2}, ${number3},${number4}, ${number5}, ${number6}`);
    };

    return (
        <div className="StackedApp">
          <header className="StackedApp-header">
            <img src={rouletteImage} className="StackedApp-logo" alt="roulette logo" />
            <div className='number-inputs'>
                <input
                    type='text'
                    placeholder='Odd_percentage'
                    value={number1}
                    onChange={(e)=>setNumber1(e.target.value)}
                    className={invalid && isNaN(number1) ? 'invalid':''}/>
            </div>
            <div className='number-inputs'>
                <input 
                        type='text'
                        placeholder='Even_percentage'
                        value={number2}
                        onChange={(e)=>setNumber2(e.target.value)}
                        className={invalid && isNaN(number2) ? 'invalid':''}/>
            </div>

            <div className='number-inputs'>
                <input
                        type='text'
                        placeholder='Red_percentage'
                        value={number3}
                        onChange={(e)=>setNumber3(e.target.value)}
                        className={invalid && isNaN(number3) ? 'invalid':''}/>
            </div>

            <div className='number-inputs'>
                <input
                        type='text'
                        placeholder='Black_percentage'
                        value={number4}
                        onChange={(e)=>setNumber4(e.target.value)}
                        className={invalid && isNaN(number4) ? 'invalid':''}/>
            </div>

            <div>
                <input
                        type='text'
                        placeholder='Low_percenatge'
                        value={number5}
                        onChange={(e)=>setNumber5(e.target.value)}
                        className={invalid && isNaN(number5) ? 'invalid':''}/>
            </div>
                
            <div>
                <input
                        type='text'
                        placeholder='High_percentage'
                        value={number6}
                        onChange={(e)=>setNumber6(e.target.value)}
                        className={invalid && isNaN(number6) ? 'invalid':''}/>
            </div>
                 
            <button className='ok-button' onClick={handleOkclick}>
                OK
            </button>
          </header>
        </div>
      );
}

export default StackedTab;
